var allowedTerrain = ['Road', 'Ground', 'Train'];

function isMovementAllowed(location, direction) {
    var x = ((location.y - 1)  * map.width) + location.x;

    for(var i = 0; i < map.layers.length; i++) {
        if(map.layers[i].data[x] > 0) {
            console.log('schwanz');
        }
    }
    return true;
}


function generateLocation(){
    return {x: Math.round(Math.random() * (map.width - 0) + 0), y: Math.round(Math.random() * (map.height - 0) + 0)};
}

io.on('connection', function (socket) {

    /**
     * User-creation
     */
    socket.on('user.session.connect', function (data) {

        var newLocation = generateLocation();

        var user = {
            id: socket.id,
            name: data.name,
            location: newLocation,
            color: colors[clients.length],
            thomas: 'richtiger schwanz'
        };

        console.log('New connection: ', data.name);

        clients.push(user);

        socket.emit('map.layout', map);
        socket.emit('user.list', socket.id, clients);

        io.emit('user.session.joined', user);
    });

    /**
     * User-movement
     */
    socket.on('user.movement', function (data) {
        var user = _.find(clients, ['id', socket.id]);
        var now = Date.now();

        if (user && now > user.lastMovement + 25 || user && !user.lastMovement) {
            if (data.left) {
                //  console.log('Movement detected: ', socket.id, ' ');
                if (isMovementAllowed(user.location, 'left')) {
                    --user.location.x;
                    user.direction = 'left';
                }
            }
            if (data.right) {
                //   console.log('Movement detected: ', socket.id, ' ');
                if (isMovementAllowed(user.location, 'right')) {
                    ++user.location.x;
                    user.direction = 'right';
                }
            }
            if (data.up) {
                //  console.log('Movement detected: ', socket.id, ' ');
                if (isMovementAllowed(user.location, 'up')) {
                    --user.location.y;
                    user.direction = 'up';
                }
            }
            if (data.down) {
                //   console.log('Movement detected: ', socket.id, ' ');
                if (isMovementAllowed(user.location, 'down')) {
                    ++user.location.y;
                    user.direction = 'down';
                }
            }

            user.lastMovement = now;
            io.emit('user.location.change', user);
        }
    });
    socket.on('disconnect', function () {
        var user = _.find(clients, ['id', socket.id]);
        console.log('User disconnected ', user.name);
        io.emit('user.session.left', user);

        var index = clients.indexOf(user);
        if(index > -1) {
            clients.splice(index, 1);
        }
    });
});

